contracts/apartmentContract.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.18;

error apartmentFound(string owner, address apartmentOwner);
error apartmentNotFound(string apartmentAddress);

contract apartmentContract {
    
    enum ApartmentState{
        Vacant, Occupied
    }

    // store apartments and find them by their city direction
    mapping (string => Apartment) private apartments;

    event NewApartmentAdded(string _apartmentAddress, string _description, uint256 _price,address _apartmentOwner);
    event ApartmentDeleted(string _apartmentAddress);
    event ApartmentUpdated(string _apartmentAddress, string _description, uint256 _price, ApartmentState _aptState ,address _apartmentOwner);
    event ApartmentDirectionChanged(string _oldApartmentAddress, string _newApartmentAdress);

    struct Apartment{
        string apartmentAddress;
        string description;
        uint256 price;
        ApartmentState aptState;
        address payable apartmentOwner;
    }

    modifier onlyNewApartment(string memory _apartmentAddress){
        if(bytes(apartments[_apartmentAddress].apartmentAddress).length != 0)
            revert apartmentFound("Owner: ",apartments[_apartmentAddress].apartmentOwner);
        _;
    }

    modifier ifApartmentExists(string memory _apartmentAddress) {
        if(bytes(apartments[_apartmentAddress].apartmentAddress).length == 0)
            revert apartmentNotFound(_apartmentAddress);
        _;
    }

    modifier ifOldApartmentExist(string memory _apartmentAddress){
        if(bytes(apartments[_apartmentAddress].apartmentAddress).length == 0)
            revert apartmentNotFound(_apartmentAddress);
        _;
    }


    function searchIfApartmentExists(string memory _apartmentAddress) public view returns (bool)
    {
        if(bytes(apartments[_apartmentAddress].apartmentAddress).length != 0)
            return true;
        else
            return false;
    }

    function addApartment(string memory _apartmentAddress, string memory _description, uint256 _price ,address _apartmentOwner) public 
        onlyNewApartment(_apartmentAddress)
    {
        apartments[_apartmentAddress] = Apartment(_apartmentAddress,  _description, _price, ApartmentState.Vacant, payable(_apartmentOwner));
        emit NewApartmentAdded(_apartmentAddress,  _description, _price, _apartmentOwner);
    }

    function getApartment(string memory _apartmentAddress) public view ifApartmentExists(_apartmentAddress) returns (Apartment memory)
    {
        return apartments[_apartmentAddress];
    }

    function isApartmentVacant(string memory _apartmentAddress) public view returns (bool)
    {
        if(apartments[_apartmentAddress].aptState == ApartmentState.Vacant)
            return true;
        else
            return false;
    }

    function getApartmentOwner(string memory _apartmentAddress) public view ifApartmentExists(_apartmentAddress) returns (address)
    {
        return apartments[_apartmentAddress].apartmentOwner;
    }

    function getApartmentPrice(string memory _apartmentAddress) public view ifApartmentExists(_apartmentAddress) returns (uint256)
    {
        return apartments[_apartmentAddress].price;
    }

    function updateApartmentParams(string memory _apartmentAddress, string memory _description, uint256 _price, ApartmentState _aptState,address _apartmentOwner) public ifApartmentExists(_apartmentAddress)
    {
        apartments[_apartmentAddress].description = _description;
        apartments[_apartmentAddress].price = _price;
        apartments[_apartmentAddress].aptState = _aptState;
        apartments[_apartmentAddress].apartmentOwner = payable(_apartmentOwner);

        emit ApartmentUpdated(_apartmentAddress,  _description, _price, _aptState, _apartmentOwner);
    }

    function updateApartmentDirection(string memory _oldApartmentAddress, string memory _newApartmentAdress) public ifOldApartmentExist(_oldApartmentAddress){
        
        apartments[_newApartmentAdress].apartmentAddress = _newApartmentAdress;
        apartments[_newApartmentAdress].description = apartments[_oldApartmentAddress].description;
        apartments[_newApartmentAdress].price = apartments[_oldApartmentAddress].price;
        apartments[_newApartmentAdress].aptState = apartments[_oldApartmentAddress].aptState;
        apartments[_newApartmentAdress].apartmentOwner = apartments[_oldApartmentAddress].apartmentOwner;

        delete apartments[_oldApartmentAddress];

        emit ApartmentDirectionChanged(_oldApartmentAddress, _newApartmentAdress);
    }
    
    function deleteApartment(string memory _apartmentAddress) public ifApartmentExists(_apartmentAddress)
    {
        delete apartments[_apartmentAddress];
        emit ApartmentDeleted(_apartmentAddress);
    }

    function changeAparmentOwner(string memory _apartmentAddress, address _newOwner) public ifApartmentExists(_apartmentAddress)
    {
        apartments[_apartmentAddress].apartmentOwner = payable(_newOwner);
    }

}

contracts/ListAndSellApartment.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.18;

import "./apartmentContract.sol";
import "./userContract.sol";

error notTheOwner(address user);
error NotEnoughEther(uint256 eth);

contract ListAndSellApartment {
    
    userContract private user;
    apartmentContract private apartment;

    event apartmentOwnershipAdded(string _apartmentAddress, address _owner);
    event apartmentBought(string _apartmentAddress, address newOwner);

    constructor(address _deployedUserContractAddess, address _deployedApartmentContractAddress) {
        user = userContract(_deployedUserContractAddess);
        apartment = apartmentContract(_deployedApartmentContractAddress);
    }

    modifier onlyIfApartmentIsVacant (string memory _apartmentAddress){
        require(apartment.isApartmentVacant(_apartmentAddress) == true, "Sorry this apartment is not available at the moment!");
        _;
    }

    modifier onlyIfApartmentExists(string memory _apartmentAddress)
    {
        require(apartment.searchIfApartmentExists(_apartmentAddress) == true, "The apartment is not created!");
        _;
    }

    modifier onlyIfUserExists(address _userWalletAddress)
    {
        require(user.checkUserExistance(msg.sender) == true, "To perform this action u need to sign up first!");
        _;
    }

    modifier onlyOwner(address _user, string memory _apartmentAddress)
    {
        if(apartment.getApartmentOwner(_apartmentAddress) != _user)
            revert notTheOwner(_user);
        _;
    }

    modifier ifPriceIsCorrect(string memory _apartmentAddress, uint _price)
    {
        if(apartment.getApartmentPrice(_apartmentAddress) < _price)
            revert NotEnoughEther(_price);
        _;
    }

    function listAnApartment(string memory _apartmentAddress, string memory _description, uint _price) public onlyIfUserExists(msg.sender)
    {
        apartment.addApartment(_apartmentAddress,  _description, _price,  msg.sender);
        emit apartmentOwnershipAdded(_apartmentAddress, msg.sender);
    }

    function deleteApartment(string memory _apartmentAddress) public onlyOwner(msg.sender, _apartmentAddress)  {
        apartment.deleteApartment(_apartmentAddress);
    }

    function BuyApartment(string memory _apartmentAddress) public payable onlyIfApartmentExists(_apartmentAddress)
     onlyIfApartmentIsVacant(_apartmentAddress) ifPriceIsCorrect(_apartmentAddress, msg.value)
    {
        
        address payable oldOwner = payable(apartment.getApartmentOwner(_apartmentAddress));
        
        oldOwner.transfer(msg.value);

        apartment.changeAparmentOwner(_apartmentAddress, msg.sender);

        emit apartmentBought(_apartmentAddress, msg.sender);
    }
    
}

contracts/userContract.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.18;


error UserNotFound(address userAddress);
error UserFound(address userAddress);

contract userContract {
    
    mapping (address => User ) private users;

    event NewUserAdded(address userAddress, string name, uint age);
    event UserUpdated(address userAddress, string name, uint age);
    event UserDeleted(address userAddress);
    
    struct User{
        address userWalletAddress;
        string name;
        uint age;
    }

    modifier checkIfUserExist(address userAddress) {
        if(users[userAddress].userWalletAddress == address(0))
            revert UserNotFound(userAddress);
        _;
    }

    modifier onlyNewUser(address userAddress){
        if(users[userAddress].userWalletAddress != address(0))
            revert UserFound(userAddress);
        _;
    }

    function addUser(string memory _name, uint _age) public onlyNewUser(msg.sender)
    {
        require(bytes(_name).length > 0, "The name can not be empty!");
        require(_age > 17, "Current user does not meet the minimum age required!");

        users[msg.sender] = User(msg.sender, _name, _age);
        emit NewUserAdded(msg.sender, _name, _age);
    }

    function getUser() public view checkIfUserExist(msg.sender) returns (User memory)
    {
        return users[msg.sender];
    }

    function checkUserExistance(address _userWalletAddress) public view returns (bool)
    {
        if(users[_userWalletAddress].userWalletAddress != address(0))
            return true;
        else
            return false;
    }

    function updateUser(string memory _name, uint _age) public checkIfUserExist(msg.sender)
    {

        require(bytes(_name).length > 0, "The name can not be empty!");
        require(_age > 17, "Current user does not meet the minimum age required!");

        users[msg.sender].name = _name;
        users[msg.sender].age = _age;

        emit UserUpdated(msg.sender, _name, _age);
    }

    function deleteUser() public checkIfUserExist(msg.sender)
    {
        delete users[msg.sender];
        emit UserDeleted(msg.sender);
    }

}

